import React from "react";
import * as S from "./style"
// import DesenhoDrikaDev from "../../Assets/Eunomicro.png"

export default function AboutMe() {
    return (
        <S.Container>
            {/* <img src={DesenhoDrikaDev} alt="Desenho Drika no Micro" /> */}
            <S.About>
                <h1>Sobre mim</h1>
                <p>Olá! Sou Adriana Gutierrez, mas pode me chamar de Drika Dev!</p>
                <p>Iniciei meus estudos com tecnologia este ano e estou amando e curtindo cada aprendizado novo!</p>
                <p>Sempre gostei muito de computador e artesanato (sou bastante criativa e caprichosa), por isso,
                    meu sonho é unir o útil ao agradável e me tornar uma Dev de Front-End, assim vou poder unir
                    duas coisas que gosto muito e usar as minhas habilidades fazendo sites lindos
                    para os usuários terem uma experiência incrível!</p>
            </S.About>
        </S.Container>
    )
}
